import { useRef, useState } from 'react';
import { useDispatch, useSelector } from "react-redux"
import React from 'react'
import { fetchAuth, selectName, logout, selectIsAuth, fetchRegistration } from '../../redux/slices/auth';
import Header from './Header/Header';
import ''




let Home = () => {

   const name = useSelector(selectName)
   const scrollUpper = useRef(null)
   const scrollLower = useRef(null)
   const fullscreen = useRef(null)
   const handleScroll = () => {
      console.log("scroll")

      if (window.pageYOffset <= 200) {
         scrollLower.current.style.opacity = "1";
         scrollLower.current.style.cursor = "pointer";

         scrollUpper.current.style.opacity = "0";
         scrollUpper.current.style.cursor = "default";
      } else {
         scrollLower.current.style.opacity = "0";
         scrollLower.current.style.cursor = "default";

         scrollUpper.current.style.opacity = "1";
         scrollUpper.current.style.cursor = "pointer";
      }
   }
   console.log(name)

   const clickLower = () => {
      console.log("click upper")
      console.log(window.innerWidth)
      window.scrollTo({
         top: 1000000,
         left: 0,
         behavior: 'smooth'
      })
   }
   const clickUpper = () => {
      console.log("click lower")
      window.scrollTo({
         top: 0,
         left: 0,
         behavior: 'smooth'
      })
   }

